INSERT INTO `albums` VALUES (1,'Meteora','Альтернативный рок','2003-04-25','36:43:00',7,'Meteora — второй студийный альбом калифорнийской мультиплатиновой альтернативной рок-группы Linkin Park, впервые выпущенный 25 марта 2003 года. Альбом последовал за совместным проектом Reanimation, который содержал ремиксы с дебютного альбома Hybrid Theory.',31),(2,'Hybrid Theory','Альтернативный рок','2000-10-24','37:52:00',6,'Hybrid Theory (в переводе с англ. — «Теория гибридов») — дебютный альбом американской рок-группы Linkin Park, выпущенный 24 октября 2000 года на лейбле Warner Bros.',31),(3,'Minutes to Midnight','Альтернативный рок','2007-05-14','43:29:00',8,'Minutes to Midnight (в переводе с англ. — «Минуты до полуночи») — третий студийный альбом мультиплатиновой американской рок-группы Linkin Park, релиз которого состоялся 14 мая 2007 года, за исключением Северной Америки, где он был выпущен 15 мая.',31);
